int calculate_score()
{
    int score=0;
    int value=0;
    for (int row=0;row<SIZE;row++)
    {
        for(int col=0;col<SIZE;col++)
        {
            if(board[row][col]!=0)
            {
             if (board[row][col] == 1) {
     value=2;
                }

                else if (board[row][col] == 2) {
                    value=4;
                }

                else if (board[row][col] == 3) {  
                    value=8;
                }

                else if (board[row][col] == 4) {
                    value=16;
                }

                else if (board[row][col] == 5) {
                    value=32;
    }
                else if (board[row][col] == 6) {
                    value=64;
                }
                else if (board[row][col] == 7) {
                    value=128;
                }
                else if (board[row][col] == 8) {
                    value=256;
                }
                else if (board[row][col] == 9) {
                    value=512;
                }
                else if (board[row][col] == 10) {
                    value=1024;
                }
                else if (board[row][col] == 11) {
                    value=2048;
                }
                else if (board[row][col] == 12) {
                   value=4096;
                }
             score+=value;
            }
        }
    }
    return score;
}


