//to display number on hex
//i is number to be displayed
void display_hex(int i){

	//seg 7 code from 0 to 9
	char seg7[] = {0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07, 0x7F, 0x67};

	if( 99>= i && i >= 10){
		*(lower_hex_ptr) = (seg7[i/10]<<8 | seg7[i%10]);
	}else if(999 >= i && i >= 100){
		int hundred = i / 100 % 10;
		int tens = i / 10 % 10;
		int ones = i / 1 % 10;
		*(lower_hex_ptr) = (seg7[hundred]<<16 | seg7[tens ]<<8 | seg7[ones]);
	}else if(9999 >= i && i >= 1000){
		int thousoud = i / 1000 % 10;
		int hundred = i / 100 % 10;
		int tens = i / 10 % 10;
		int ones = i / 1 % 10;
		*(lower_hex_ptr) = (seg7[thousoud]<<24 |seg7[hundred]<<16 | seg7[tens ]<<8 | seg7[ones]);
	}
	else{
		*lower_hex_ptr = seg7[i];
	}
}

