// v_sync
void wait_for_vsync(){
    volatile int* pixel_ptr = 0xFF203020;
    
    *pixel_ptr = 1;
    
    pixel_ptr = pixel_ptr + 3;
    
    int status = *pixel_ptr;
    
    while (status & 0x1)
        status = *pixel_ptr;
}

